import React, { Component } from 'react'

export default class Ticket extends Component {
    render() {
        return (
            <div className="r9">
                <center>
                <h2>Rwenzori Airlines</h2>
                </center>
                <label>Flying From</label><br />
                <input type="text"/><br />

            </div>
        )
    }
}
